    const total = TotalPrice();
  return (
    <div>
      <p>微信收款码</p>
      {total>0?<div>
        <img src={checkImg} alt="checkImg"/>
        总金额：{total}
        </div>:<p>“您的购物车是空的”</p>}

    </div>
  )
}
